    public void loadProperty() {
        if (!allProperty.isEmpty())
            return;


        try {
            open();

            Cursor cu = mydb.rawQuery("select * from property_detail ", null);
//            cu.moveToPosition(row);
            cu.moveToFirst();

            for (int i = 0; !cu.isAfterLast(); i++) {
//                cu.moveToPosition(i);

                PropertyDetail c = new PropertyDetail();
                c.id = cu.getInt(cu.getColumnIndex("id"));
                c.tag = cu.getInt(cu.getColumnIndex("tag"));
                c.name = cu.getString(cu.getColumnIndex("name"));
                allProperty.put(c.id, c);
                ArrayList<PropertyDetail> cc = tagProperty.get(c.tag);
                if (cc == null) {
                    cc = new ArrayList<>();
                    tagProperty.put(c.tag, cc);
                }
                cc.add(c);
                cu.moveToNext();

            }
//            Arrays.sort(kondordialog);

        } catch (Exception e) {
            e.printStackTrace();

        }
        mapPropertyNode();


        //Cursor cu=mydb.rawQuery("select * from advers where hoze=66 and ver =0 and day = " + UserConfig.dayadversok, null);

    }

    public void mapPropertyNode() {
        for (Node a : allNodes.values()) {
            if (a.feature == null || a.feature.length() == 0)
                continue;
            String[] split = a.feature.split(",");
            for (String s : split)
                a.pDetail.add(allProperty.get(Integer.parseInt(s)));

        }
    }

